import React from 'react';
import Map from './Map';

const App: React.FC = () => {
  return (
    <div>
      {/* Header */}
      <div>
        <h1 style={{ fontFamily: 'era', textAlign: 'center' }}>TAYLOR SWIFT: THE ERAS TOUR</h1>
        <h1 style={{ fontFamily: 'era', textAlign: 'center' }}>Eras Tour Tracker</h1>
      </div>

      {/* Main Content */}
      <div className="flex flex-col md:flex-row m-10">
        {/* Map */}
        <div className="flex-1 m-5 p-5 bg-white shadow-md">
          <Map />
        </div>

        {/* Legend */}
        <div className="flex-1 m-5 p-5 bg-white shadow-md flex flex-col items-center">
          <h2 className="mb-4 text-xl">Legend</h2>
          <div className="flex items-center space-x-2 mb-2">
            <div className="w-4 h-4 bg-red-500 animate-pulse rounded-full"></div>
            <span className="text-gray-700">Tour Locations</span>
          </div>
          <div className="flex items-center space-x-2 mb-2">
            <div className="w-4 h-4 bg-blue-500 animate-pulse rounded-full"></div>
            <span className="text-gray-700">Future Locations</span>
          </div>
          <div className="flex items-center space-x-2 mb-2">
            <div className="w-4 h-4 bg-green-500 animate-pulse rounded-full"></div>
            <span className="text-gray-700">Completed Locations</span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default App;
